import { AppHolder } from './AppHolder.js';

class AdminPortal {
    static show(name = 'default') {
        AppHolder.getInstance(name).showAdminPortal();
    }
    static hide(name = 'default') {
        AppHolder.getInstance(name).hideAdminPortal();
    }
}

export { AdminPortal };
